import { ImageBackground, StyleSheet, Text, View , Image, TouchableWithoutFeedback} from 'react-native';

const slider = ({width, height, state}) =>{
    return(
    <View style={{width:width, height:height, backgroundColor:'white', marginTop:30, borderRadius:45, opacity:0.3}}>
        <View style={{width:state, height:'100%'}}></View>
    </View>
    );
}

export default slider;
